const style = {display:'flex' , flexDirection:'column' , justifyContent:'center',  backgroundColor: 'green', width: '800px' , height:'500px' };

const Button = () => {
  return (
		<div className="button" style={style}>
    	<Button />
		</div>

  );
};

export default Button;
